  // console.log(User.person.firstName);

  const isActivePage = useSelector(selectPage);

  return (
    <div className="App">
      <HeaderMenu />
      <MainConteiner>
        {isActivePage ? <PersonPage /> : <CompanyPage />}
        <Link href="https://www.npmjs.com/package/@reduxjs/toolkit">
          <Icon id="facebook" className="all" /> asdfsadsadsad
        </Link>
        <Footer />
      </MainConteiner>
    </div>
  );
}

export default App;
